import React from 'react';

function Stock(props){
    return (
        <ul>
            <li>{props.symbol}</li>
            <li>{props.price}</li>
            <li>{props.quantity}</li>
            <li>{props.volume}</li>
            {/* <li>{props.date}</li> */}
        </ul>
    );
}

export default Stock;
